INSERT INTO `wp_wc_admin_notes` (`note_id`, `name`, `type`, `locale`, `title`, `content`, `content_data`, `status`, `source`, `date_created`, `date_reminder`, `is_snoozable`, `layout`, `image`, `is_deleted`, `icon`, `is_read`) VALUES
(1,	'eu_vat_changes_2021',	'marketing',	'en_US',	'Get your business ready for the new EU tax regulations',	'On July 1, 2021, new taxation rules will come into play when the <a href=\"https://ec.europa.eu/taxation_customs/business/vat/modernising-vat-cross-border-ecommerce_en\">European Union (EU) Value-Added Tax (VAT) eCommerce package</a> takes effect.<br /><br />The new regulations will impact virtually every B2C business involved in cross-border eCommerce trade with the EU.<br /><br />We therefore recommend <a href=\"https://woocommerce.com/posts/new-eu-vat-regulations\">familiarizing yourself with the new updates</a>, and consult with a tax professional to ensure your business is following regulations and best practice.',	'{}',	'unactioned',	'woocommerce.com',	'2021-06-25 22:44:20',	NULL,	0,	'plain',	'',	0,	'info',	1),
(2,	'paypal_ppcp_gtm_2021',	'marketing',	'en_US',	'Offer more options with the new PayPal',	'Get the latest PayPal extension for a full suite of payment methods with extensive currency and country coverage.',	'{}',	'pending',	'woocommerce.com',	'2021-06-25 22:44:20',	NULL,	0,	'plain',	'',	0,	'info',	1),
(3,	'facebook_pixel_api_2021',	'marketing',	'en_US',	'Improve the performance of your Facebook ads',	'Enable Facebook Pixel and Conversions API through the latest version of Facebook for WooCommerce for improved measurement and ad targeting capabilities.',	'{}',	'pending',	'woocommerce.com',	'2021-06-25 22:44:20',	NULL,	0,	'plain',	'',	0,	'info',	1),
(4,	'facebook_ec_2021',	'marketing',	'en_US',	'Sync your product catalog with Facebook to help boost sales',	'A single click adds all products to your Facebook Business Page shop. Product changes are automatically synced, with the flexibility to control which products are listed.',	'{}',	'pending',	'woocommerce.com',	'2021-06-25 22:44:20',	NULL,	0,	'plain',	'',	0,	'info',	1),
(5,	'ecomm-need-help-setting-up-your-store',	'info',	'en_US',	'Need help setting up your Store?',	'Schedule a free 30-min <a href=\"https://wordpress.com/support/concierge-support/\">quick start session</a> and get help from our specialists. We’re happy to walk through setup steps, show you around the WordPress.com dashboard, troubleshoot any issues you may have, and help you the find the features you need to accomplish your goals for your site.',	'{}',	'pending',	'woocommerce.com',	'2021-06-25 22:44:20',	NULL,	0,	'plain',	'',	0,	'info',	1),
(6,	'woocommerce-services',	'info',	'en_US',	'WooCommerce Shipping & Tax',	'WooCommerce Shipping &amp; Tax helps get your store \"ready to sell\" as quickly as possible. You create your products. We take care of tax calculation, payment processing, and shipping label printing! Learn more about the extension that you just installed.',	'{}',	'unactioned',	'woocommerce.com',	'2021-06-25 22:48:17',	NULL,	0,	'plain',	'',	0,	'info',	1),
(7,	'ecomm-unique-shopping-experience',	'info',	'en_US',	'For a shopping experience as unique as your customers',	'Product Add-Ons allow your customers to personalize products while they\'re shopping on your online store. No more follow-up email requests—customers get what they want, before they\'re done checking out. Learn more about this extension that comes included in your plan.',	'{}',	'pending',	'woocommerce.com',	'2021-06-25 22:44:20',	NULL,	0,	'plain',	'',	0,	'info',	1),
(8,	'wc-admin-getting-started-in-ecommerce',	'info',	'en_US',	'Getting Started in eCommerce - webinar',	'We want to make eCommerce and this process of getting started as easy as possible for you. Watch this webinar to get tips on how to have our store up and running in a breeze.',	'{}',	'pending',	'woocommerce.com',	'2021-06-25 22:44:20',	NULL,	0,	'plain',	'',	0,	'info',	1),
(9,	'your-first-product',	'info',	'en_US',	'Your first product',	'That’s huge! You’re well on your way to building a successful online store — now it’s time to think about how you’ll fulfill your orders.<br /><br />Read our shipping guide to learn best practices and options for putting together your shipping strategy. And for WooCommerce stores in the United States, you can print discounted shipping labels via USPS with <a href=\"https://href.li/?https://woocommerce.com/shipping\" target=\"_blank\">WooCommerce Shipping</a>.',	'{}',	'unactioned',	'woocommerce.com',	'2021-06-26 21:03:22',	NULL,	0,	'plain',	'',	0,	'info',	1),
(10,	'wc-square-apple-pay-boost-sales',	'marketing',	'en_US',	'Boost sales with Apple Pay',	'Now that you accept Apple Pay® with Square you can increase conversion rates by letting your customers know that Apple Pay® is available. Here’s a marketing guide to help you get started.',	'{}',	'pending',	'woocommerce.com',	'2021-06-25 22:44:20',	NULL,	0,	'plain',	'',	0,	'info',	1),
(11,	'wc-square-apple-pay-grow-your-business',	'marketing',	'en_US',	'Grow your business with Square and Apple Pay ',	'Now more than ever, shoppers want a fast, simple, and secure online checkout experience. Increase conversion rates by letting your customers know that you now accept Apple Pay®.',	'{}',	'pending',	'woocommerce.com',	'2021-06-25 22:44:20',	NULL,	0,	'plain',	'',	0,	'info',	1),
(12,	'wcpay-apple-pay-is-now-available',	'marketing',	'en_US',	'Apple Pay is now available with WooCommerce Payments!',	'Increase your conversion rate by offering a fast and secure checkout with <a href=\"https://woocommerce.com/apple-pay/?utm_source=inbox&amp;utm_medium=product&amp;utm_campaign=wcpay_applepay\" target=\"_blank\">Apple Pay</a>®. It’s free to get started with <a href=\"https://woocommerce.com/payments/?utm_source=inbox&amp;utm_medium=product&amp;utm_campaign=wcpay_applepay\" target=\"_blank\">WooCommerce Payments</a>.',	'{}',	'pending',	'woocommerce.com',	'2021-06-25 22:44:20',	NULL,	0,	'plain',	'',	0,	'info',	1),
(13,	'wcpay-apple-pay-boost-sales',	'marketing',	'en_US',	'Boost sales with Apple Pay',	'Now that you accept Apple Pay® with WooCommerce Payments you can increase conversion rates by letting your customers know that Apple Pay® is available. Here’s a marketing guide to help you get started.',	'{}',	'pending',	'woocommerce.com',	'2021-06-25 22:44:20',	NULL,	0,	'plain',	'',	0,	'info',	1),
(14,	'wcpay-apple-pay-grow-your-business',	'marketing',	'en_US',	'Grow your business with WooCommerce Payments and Apple Pay',	'Now more than ever, shoppers want a fast, simple, and secure online checkout experience. Increase conversion rates by letting your customers know that you now accept Apple Pay®.',	'{}',	'pending',	'woocommerce.com',	'2021-06-25 22:44:20',	NULL,	0,	'plain',	'',	0,	'info',	1),
(15,	'wc-admin-optimizing-the-checkout-flow',	'info',	'en_US',	'Optimizing the checkout flow',	'It’s crucial to get your store’s checkout as smooth as possible to avoid losing sales. Let’s take a look at how you can optimize the checkout experience for your shoppers.',	'{}',	'unactioned',	'woocommerce.com',	'2022-05-13 18:48:32',	NULL,	0,	'plain',	'',	0,	'info',	1),
(16,	'wc-admin-first-five-things-to-customize',	'info',	'en_US',	'The first 5 things to customize in your store',	'Deciding what to start with first is tricky. To help you properly prioritize, we’ve put together this short list of the first few things you should customize in WooCommerce.',	'{}',	'unactioned',	'woocommerce.com',	'2021-08-14 01:00:10',	NULL,	0,	'plain',	'',	0,	'info',	0),
(17,	'wc-payments-qualitative-feedback',	'info',	'en_US',	'WooCommerce Payments setup - let us know what you think',	'Congrats on enabling WooCommerce Payments for your store. Please share your feedback in this 2 minute survey to help us improve the setup process.',	'{}',	'pending',	'woocommerce.com',	'2021-06-25 22:44:20',	NULL,	0,	'plain',	'',	0,	'info',	1),
(18,	'share-your-feedback-on-paypal',	'info',	'en_US',	'Share your feedback on PayPal',	'Share your feedback in this 2 minute survey about how we can make the process of accepting payments more useful for your store.',	'{}',	'pending',	'woocommerce.com',	'2021-06-25 22:44:20',	NULL,	0,	'plain',	'',	0,	'info',	1),
(19,	'wcpay_instant_deposits_gtm_2021',	'marketing',	'en_US',	'Get paid within minutes – Instant Deposits for WooCommerce Payments',	'Stay flexible with immediate access to your funds when you need them – including nights, weekends, and holidays. With <a href=\"https://woocommerce.com/products/woocommerce-payments/?utm_source=inbox&amp;utm_medium=product&amp;utm_campaign=wcpay_instant_deposits\">WooCommerce Payments\'</a> new Instant Deposits feature, you’re able to transfer your earnings to a debit card within minutes.',	'{}',	'pending',	'woocommerce.com',	'2021-06-25 22:44:20',	NULL,	0,	'plain',	'',	0,	'info',	1),
(20,	'google_listings_and_ads_install',	'marketing',	'en_US',	'Drive traffic and sales with Google',	'Reach online shoppers to drive traffic and sales for your store by showcasing products across Google, for free or with ads.',	'{}',	'pending',	'woocommerce.com',	'2021-06-25 22:44:20',	NULL,	0,	'plain',	'',	0,	'info',	1),
(21,	'wc-subscriptions-security-update-3-0-15',	'info',	'en_US',	'WooCommerce Subscriptions security update!',	'We recently released an important security update to WooCommerce Subscriptions. To ensure your site’s data is protected, please upgrade <strong>WooCommerce Subscriptions to version 3.0.15</strong> or later.<br /><br />Click the button below to view and update to the latest Subscriptions version, or log in to <a href=\"https://woocommerce.com/my-dashboard\">WooCommerce.com Dashboard</a> and navigate to your <strong>Downloads</strong> page.<br /><br />We recommend always using the latest version of WooCommerce Subscriptions, and other software running on your site, to ensure maximum security.<br /><br />If you have any questions we are here to help — just <a href=\"https://woocommerce.com/my-account/create-a-ticket/\">open a ticket</a>.',	'{}',	'pending',	'woocommerce.com',	'2021-06-25 22:44:20',	NULL,	0,	'plain',	'',	0,	'info',	1),
(22,	'woocommerce-core-update-5-4-0',	'info',	'en_US',	'Update to WooCommerce 5.4.1 now',	'WooCommerce 5.4.1 addresses a checkout issue discovered in WooCommerce 5.4. We recommend upgrading to WooCommerce 5.4.1 as soon as possible.',	'{}',	'pending',	'woocommerce.com',	'2021-06-25 22:44:20',	NULL,	0,	'plain',	'',	0,	'info',	1),
(23,	'wcpay-promo-2020-11',	'marketing',	'en_US',	'wcpay-promo-2020-11',	'wcpay-promo-2020-11',	'{}',	'pending',	'woocommerce.com',	'2021-06-25 22:44:20',	NULL,	0,	'plain',	'',	0,	'info',	1),
(24,	'wcpay-promo-2020-12',	'marketing',	'en_US',	'wcpay-promo-2020-12',	'wcpay-promo-2020-12',	'{}',	'pending',	'woocommerce.com',	'2021-06-25 22:44:20',	NULL,	0,	'plain',	'',	0,	'info',	1),
(25,	'wcpay-promo-2021-6-incentive-1',	'marketing',	'en_US',	'Simplify the payments process for you and your customers with WooCommerce Payments',	'With <a href=\"https://woocommerce.com/payments/?utm_medium=notification&amp;utm_source=product&amp;utm_campaign=wcpay601\">WooCommerce Payments</a>, you can securely accept all major cards, Apple Pay®, and recurring revenue in over 100 currencies.\n				Built into your store’s WooCommerce dashboard, track cash flow and manage all of your transactions in one place – with no setup costs or monthly fees.\n				<br /><br />\n				By clicking \"Get WooCommerce Payments,\" you agree to the <a href=\"https://wordpress.com/tos/?utm_medium=notification&amp;utm_source=product&amp;utm_campaign=wcpay601\">Terms of Service</a>\n				and acknowledge you have read the <a href=\"https://automattic.com/privacy/\">Privacy Policy</a>.\n				',	'{}',	'pending',	'woocommerce.com',	'2021-06-25 22:44:20',	NULL,	0,	'plain',	'',	0,	'info',	1),
(26,	'wcpay-promo-2021-6-incentive-2',	'marketing',	'en_US',	'Simplify the payments process for you and your customers with WooCommerce Payments',	'With <a href=\"https://woocommerce.com/payments/?utm_medium=notification&amp;utm_source=product&amp;utm_campaign=wcpay601\">WooCommerce Payments</a>, you can securely accept all major cards, Apple Pay®, and recurring revenue in over 100 currencies.\n				Built into your store’s WooCommerce dashboard, track cash flow and manage all of your transactions in one place – with no setup costs or monthly fees.\n				<br /><br />\n				By clicking \"Get WooCommerce Payments,\" you agree to the <a href=\"https://wordpress.com/tos/?utm_medium=notification&amp;utm_source=product&amp;utm_campaign=wcpay601\">Terms of Service</a>\n				and acknowledge you have read the <a href=\"https://automattic.com/privacy/\">Privacy Policy</a>.\n				',	'{}',	'pending',	'woocommerce.com',	'2021-06-25 22:44:20',	NULL,	0,	'plain',	'',	0,	'info',	1),
(27,	'ppxo-pps-upgrade-paypal-payments-1',	'info',	'en_US',	'Get the latest PayPal extension for WooCommerce',	'Heads up! There’s a new PayPal on the block!<br /><br />Now is a great time to upgrade to our latest <a href=\"https://woocommerce.com/products/woocommerce-paypal-payments/\" target=\"_blank\">PayPal extension</a> to continue to receive support and updates with PayPal.<br /><br />Get access to a full suite of PayPal payment methods, extensive currency and country coverage, and pay later options with the all-new PayPal extension for WooCommerce.',	'{}',	'pending',	'woocommerce.com',	'2021-06-25 22:44:20',	NULL,	0,	'plain',	'',	0,	'info',	1),
(28,	'ppxo-pps-upgrade-paypal-payments-2',	'info',	'en_US',	'Upgrade your PayPal experience!',	'Get access to a full suite of PayPal payment methods, extensive currency and country coverage, offer subscription and recurring payments, and the new PayPal pay later options.<br /><br />Start using our <a href=\"https://woocommerce.com/products/woocommerce-paypal-payments/\" target=\"_blank\">latest PayPal today</a> to continue to receive support and updates.',	'{}',	'unactioned',	'woocommerce.com',	'2021-08-03 21:01:10',	NULL,	0,	'plain',	'',	0,	'info',	1),
(29,	'wc-admin-onboarding-email-marketing',	'info',	'en_US',	'Sign up for tips, product updates, and inspiration',	'We\'re here for you - get tips, product updates and inspiration straight to your email box',	'{}',	'unactioned',	'woocommerce-admin',	'2021-06-25 22:44:20',	NULL,	0,	'plain',	'',	0,	'info',	1),
(30,	'wc-admin-wc-helper-connection',	'info',	'en_US',	'Connect to WooCommerce.com',	'Connect to get important product notifications and updates.',	'{}',	'unactioned',	'woocommerce-admin',	'2021-06-25 22:44:21',	NULL,	0,	'plain',	'',	0,	'info',	1),
(31,	'wc-admin-selling-online-courses',	'marketing',	'en_US',	'Do you want to sell online courses?',	'Online courses are a great solution for any business that can teach a new skill. Since courses don’t require physical product development or shipping, they’re affordable, fast to create, and can generate passive income for years to come. In this article, we provide you more information about selling courses using WooCommerce.',	'{}',	'unactioned',	'woocommerce-admin',	'2021-06-25 22:45:49',	NULL,	0,	'plain',	'',	0,	'info',	1),
(33,	'wc-admin-choosing-a-theme',	'marketing',	'en_US',	'Choosing a theme?',	'Check out the themes that are compatible with WooCommerce and choose one aligned with your brand and business needs.',	'{}',	'unactioned',	'woocommerce-admin',	'2021-06-26 22:46:10',	NULL,	0,	'plain',	'',	0,	'info',	1),
(34,	'wc-admin-insight-first-product-and-payment',	'survey',	'en_US',	'Insight',	'More than 80% of new merchants add the first product and have at least one payment method set up during the first week.<br><br>Do you find this type of insight useful?',	'{}',	'unactioned',	'woocommerce-admin',	'2021-06-26 22:46:10',	NULL,	0,	'plain',	'',	0,	'info',	1),
(35,	'wc-admin-first-downloadable-product',	'info',	'en_US',	'Learn more about digital/downloadable products',	'Congrats on adding your first digital product! You can learn more about how to handle digital or downloadable products in our documentation.',	'{}',	'unactioned',	'woocommerce-admin',	'2021-06-26 22:46:10',	NULL,	0,	'plain',	'',	0,	'info',	1),
(36,	'wc-admin-mobile-app',	'info',	'en_US',	'Install Woo mobile app',	'Install the WooCommerce mobile app to manage orders, receive sales notifications, and view key metrics — wherever you are.',	'{}',	'unactioned',	'woocommerce-admin',	'2021-06-27 22:44:38',	NULL,	0,	'plain',	'',	0,	'info',	1),
(38,	'wc-admin-customizing-product-catalog',	'info',	'en_US',	'How to customize your product catalog',	'You want your product catalog and images to look great and align with your brand. This guide will give you all the tips you need to get your products looking great in your store.',	'{}',	'unactioned',	'woocommerce-admin',	'2021-06-29 05:13:09',	NULL,	0,	'plain',	'',	0,	'info',	1),
(39,	'wc-admin-usage-tracking-opt-in',	'info',	'en_US',	'Help WooCommerce improve with usage tracking',	'Gathering usage data allows us to improve WooCommerce. Your store will be considered as we evaluate new features, judge the quality of an update, or determine if an improvement makes sense. You can always visit the <a href=\"https://store.intakedigital.loc/wp-admin/admin.php?page=wc-settings&#038;tab=advanced&#038;section=woocommerce_com\" target=\"_blank\">Settings</a> and choose to stop sharing data. <a href=\"https://woocommerce.com/usage-tracking\" target=\"_blank\">Read more</a> about what data we collect.',	'{}',	'unactioned',	'woocommerce-admin',	'2021-07-31 21:54:08',	NULL,	0,	'plain',	'',	0,	'info',	1),
(40,	'wc-admin-onboarding-payments-reminder',	'info',	'en_US',	'Start accepting payments on your store!',	'Take payments with the provider that’s right for you - choose from 100+ payment gateways for WooCommerce.',	'{}',	'unactioned',	'woocommerce-admin',	'2021-07-31 21:54:08',	NULL,	0,	'plain',	'',	0,	'info',	1),
(42,	'wc-admin-insight-first-sale',	'survey',	'en_US',	'Did you know?',	'A WooCommerce powered store needs on average 31 days to get the first sale. You\'re on the right track! Do you find this type of insight useful?',	'{}',	'unactioned',	'woocommerce-admin',	'2021-07-31 21:54:08',	NULL,	0,	'plain',	'',	0,	'info',	1),
(43,	'wc-admin-customize-store-with-blocks',	'info',	'en_US',	'Customize your online store with WooCommerce blocks',	'With our blocks, you can select and display products, categories, filters, and more virtually anywhere on your site — no need to use shortcodes or edit lines of code. Learn more about how to use each one of them.',	'{}',	'unactioned',	'woocommerce-admin',	'2021-07-31 21:54:08',	NULL,	0,	'plain',	'',	0,	'info',	1),
(44,	'wayflyer_q3_2021',	'marketing',	'en_US',	'Grow your revenue with Wayflyer financing and analytics',	'Flexible financing tailored to your needs by <a href=\"https://woocommerce.com/products/wayflyer/\">Wayflyer</a> – one fee, no interest rates, penalties, equity, or personal guarantees. Based on your store\'s performance, Wayflyer can provide the financing you need to grow and the analytical insights to help you spend it.',	'{}',	'pending',	'woocommerce.com',	'2021-07-31 21:54:08',	NULL,	0,	'plain',	'',	0,	'info',	1),
(45,	'woocommerce-core-sqli-july-2021-need-to-update',	'update',	'en_US',	'Action required: Critical vulnerabilities in WooCommerce',	'In response to a critical vulnerability identified on July 13, 2021, we are working with the WordPress Plugins Team to deploy software updates to stores running WooCommerce (versions 3.3 to 5.5) and the WooCommerce Blocks feature plugin (versions 2.5 to 5.5).<br /><br />Our investigation into this vulnerability is ongoing, but <strong>we wanted to let you know now about the importance of updating immediately</strong>.<br /><br />For more information on which actions you should take, as well as answers to FAQs, please urgently review our blog post detailing this issue.',	'{}',	'actioned',	'woocommerce.com',	'2021-07-31 21:54:09',	NULL,	0,	'plain',	'',	0,	'info',	1),
(46,	'woocommerce-blocks-sqli-july-2021-need-to-update',	'update',	'en_US',	'Action required: Critical vulnerabilities in WooCommerce Blocks',	'In response to a critical vulnerability identified on July 13, 2021, we are working with the WordPress Plugins Team to deploy software updates to stores running WooCommerce (versions 3.3 to 5.5) and the WooCommerce Blocks feature plugin (versions 2.5 to 5.5).<br /><br />Our investigation into this vulnerability is ongoing, but <strong>we wanted to let you know now about the importance of updating immediately</strong>.<br /><br />For more information on which actions you should take, as well as answers to FAQs, please urgently review our blog post detailing this issue.',	'{}',	'pending',	'woocommerce.com',	'2021-07-31 21:54:09',	NULL,	0,	'plain',	'',	0,	'info',	1),
(47,	'woocommerce-core-sqli-july-2021-store-patched',	'update',	'en_US',	'Solved: Critical vulnerabilities patched in WooCommerce',	'In response to a critical vulnerability identified on July 13, 2021, we worked with the WordPress Plugins Team to deploy software updates to stores running WooCommerce (versions 3.3 to 5.5) and the WooCommerce Blocks feature plugin (versions 2.5 to 5.5).<br /><br /><strong>Your store has been updated to the latest secure version(s)</strong>. For more information and answers to FAQs, please review our blog post detailing this issue.',	'{}',	'pending',	'woocommerce.com',	'2021-07-31 21:54:09',	NULL,	0,	'plain',	'',	0,	'info',	1),
(48,	'woocommerce-blocks-sqli-july-2021-store-patched',	'update',	'en_US',	'Solved: Critical vulnerabilities patched in WooCommerce Blocks',	'In response to a critical vulnerability identified on July 13, 2021, we worked with the WordPress Plugins Team to deploy software updates to stores running WooCommerce (versions 3.3 to 5.5) and the WooCommerce Blocks feature plugin (versions 2.5 to 5.5).<br /><br /><strong>Your store has been updated to the latest secure version(s)</strong>. For more information and answers to FAQs, please review our blog post detailing this issue.',	'{}',	'pending',	'woocommerce.com',	'2021-07-31 21:54:09',	NULL,	0,	'plain',	'',	0,	'info',	1),
(49,	'wc-admin-marketing-jetpack-backup',	'marketing',	'en_US',	'Protect your WooCommerce Store with Jetpack Backup.',	'Store downtime means lost sales. One-click restores get you back online quickly if something goes wrong.',	'{}',	'unactioned',	'woocommerce-admin-notes',	'2021-08-03 23:50:12',	NULL,	0,	'plain',	'',	0,	'info',	1),
(50,	'wc-admin-orders-milestone',	'info',	'en_US',	'First order received',	'Congratulations on getting your first order! Now is a great time to learn how to manage your orders.',	'{}',	'unactioned',	'woocommerce-admin',	'2021-08-14 00:45:06',	NULL,	0,	'plain',	'',	0,	'info',	0),
