(52,	'wc-refund-returns-page',	'info',	'en_US',	'Setup a Refund and Returns Policy page to boost your store\'s credibility.',	'We have created a sample draft Refund and Returns Policy page for you. Please have a look and update it to fit your store.',	'{}',	'unactioned',	'woocommerce-core',	'2021-08-21 22:51:11',	NULL,	0,	'plain',	'',	0,	'info',	0),
