(54,	'stripe_applepay_holiday2021',	'marketing',	'en_US',	'Boost sales this holiday season with Apple Pay!',	'Increase your conversion rate by letting your customers know that you accept Apple Pay. It’s seamless to <a href=\"https://docs.woocommerce.com/document/stripe/?_ga=2.90941597.642705274.1635776464-1391993999.1621950839#apple-pay\">enable Apple Pay with Stripe</a> and easy to communicate it with this <a href=\"https://developer.apple.com/apple-pay/marketing/\">marketing guide</a>.',	'{}',	'pending',	'woocommerce.com',	'2022-01-30 19:16:43',	NULL,	0,	'plain',	'',	0,	'info',	0),
(55,	'square_applepay_holiday2021',	'marketing',	'en_US',	'Boost sales this holiday season with Apple Pay!',	'Increase your conversion rate by letting your customers know that you accept Apple Pay. It’s seamless to <a href=\"https://docs.woocommerce.com/document/woocommerce-square/?_ga=2.90941597.642705274.1635776464-1391993999.1621950839#section-14\">enable Apple Pay with Square</a> and easy to communicate it with this <a href=\"https://developer.apple.com/apple-pay/marketing/\">marketing guide</a>.',	'{}',	'pending',	'woocommerce.com',	'2022-01-30 19:16:43',	NULL,	0,	'plain',	'',	0,	'info',	0),
(56,	'wcpay_applepay_holiday2021',	'marketing',	'en_US',	'Boost sales this holiday season with Apple Pay!',	'Increase your conversion rate by letting your customers know that you accept Apple Pay. It’s seamless to <a href=\"https://docs.woocommerce.com/document/payments/apple-pay/\">enable Apple Pay with WooCommerce Payments</a> and easy to communicate it with this <a href=\"https://developer.apple.com/apple-pay/marketing/\">marketing guide</a>.',	'{}',	'pending',	'woocommerce.com',	'2022-01-30 19:16:43',	NULL,	0,	'plain',	'',	0,	'info',	0),
(57,	'new_in_app_marketplace_2021',	'info',	'en_US',	'Customize your store with extensions',	'Check out our NEW Extensions tab to see our favorite extensions for customizing your store, and discover the most popular extensions in the WooCommerce Marketplace.',	'{}',	'unactioned',	'woocommerce.com',	'2022-01-30 19:43:47',	NULL,	0,	'plain',	'',	0,	'info',	0),
(58,	'wayflyer_bnpl_q4_2021',	'marketing',	'en_US',	'Grow your business with funding through Wayflyer',	'Fast, flexible financing to boost cash flow and help your business grow – one fee, no interest rates, penalties, equity, or personal guarantees. Based on your store’s performance, Wayflyer provides funding and analytical insights to invest in your business.',	'{}',	'pending',	'woocommerce.com',	'2022-01-30 19:16:43',	NULL,	0,	'plain',	'',	0,	'info',	0),
(59,	'wc_shipping_mobile_app_usps_q4_2021',	'marketing',	'en_US',	'Print and manage your shipping labels with WooCommerce Shipping and the WooCommerce Mobile App',	'Save time by printing, purchasing, refunding, and tracking shipping labels generated by <a href=\"https://woocommerce.com/woocommerce-shipping/\">WooCommerce Shipping</a> – all directly from your mobile device!',	'{}',	'pending',	'woocommerce.com',	'2022-01-30 19:16:43',	NULL,	0,	'plain',	'',	0,	'info',	0),
