(61,	'habit-moment-survey',	'marketing',	'en_US',	'We’re all ears! Share your experience so far with WooCommerce',	'We’d love your input to shape the future of WooCommerce together. Feel free to share any feedback, ideas or suggestions that you have.',	'{}',	'pending',	'woocommerce.com',	'2022-01-30 19:16:43',	NULL,	0,	'plain',	'',	0,	'info',	0),
(62,	'ecomm-wc-navigation-survey',	'info',	'en_US',	'We’d like your feedback on the WooCommerce navigation',	'We’re making improvements to the WooCommerce navigation and would love your feedback. Share your experience in this 2 minute survey.',	'{}',	'pending',	'woocommerce.com',	'2022-01-30 19:16:43',	NULL,	0,	'plain',	'',	0,	'info',	0),
