(65,	'woocommerce-core-paypal-march-2022-updated',	'update',	'en_US',	'Security auto-update of WooCommerce',	'<strong>Your store has been updated to the latest secure version of WooCommerce</strong>. We worked with WordPress to deploy PayPal Standard security updates for stores running WooCommerce (version 3.5 to 6.3). It’s recommended to disable PayPal Standard, and use <a href=\"https://woocommerce.com/products/woocommerce-paypal-payments/\" target=\"_blank\">PayPal Payments</a> to accept PayPal.',	'{}',	'pending',	'woocommerce.com',	'2022-05-12 21:28:16',	NULL,	0,	'plain',	'',	0,	'info',	0),
(66,	'woocommerce-core-paypal-march-2022-updated-nopp',	'update',	'en_US',	'Security auto-update of WooCommerce',	'<strong>Your store has been updated to the latest secure version of WooCommerce</strong>. We worked with WordPress to deploy security updates related to PayPal Standard payment gateway for stores running WooCommerce (version 3.5 to 6.3).',	'{}',	'pending',	'woocommerce.com',	'2022-05-12 21:28:16',	NULL,	0,	'plain',	'',	0,	'info',	0),
(67,	'pinterest_03_2022_update',	'marketing',	'en_US',	'Your Pinterest for WooCommerce plugin is out of date!',	'Update to the latest version of Pinterest for WooCommerce to continue using this plugin and keep your store connected with Pinterest. To update, visit <strong>Plugins &gt; Installed Plugins</strong>, and click on “update now” under Pinterest for WooCommerce.',	'{}',	'pending',	'woocommerce.com',	'2022-05-12 21:28:16',	NULL,	0,	'plain',	'',	0,	'info',	0),
