(70,	'store_setup_survey_survey_q2_2022',	'survey',	'en_US',	'How is your store setup going?',	'Our goal is to make sure you have all the right tools to start setting up your store in the smoothest way possible.\r\nWe’d love to know if we hit our mark and how we can improve. To collect your thoughts, we made a 2-minute survey.',	'{}',	'pending',	'woocommerce.com',	'2022-05-12 21:28:16',	NULL,	0,	'plain',	'',	0,	'info',	0),
(71,	'wc-admin-navigation-nudge',	'info',	'en_US',	'You now have access to the WooCommerce navigation',	'We’re introducing a new navigation for a more intuitive and improved user experience. You can enable the beta version of the new experience in the Advanced Settings. Enable it now for your store.',	'{}',	'unactioned',	'woocommerce-admin',	'2022-05-12 22:45:47',	NULL,	0,	'plain',	'',	0,	'info',	0),
(72,	'wc-admin-launch-checklist',	'info',	'en_US',	'Ready to launch your store?',	'To make sure you never get that sinking \"what did I forget\" feeling, we\'ve put together the essential pre-launch checklist.',	'{}',	'unactioned',	'woocommerce-admin',	'2022-06-04 20:30:28',	NULL,	0,	'plain',	'',	0,	'info',	0),
(73,	'wc-admin-EU-consumer-protection',	'marketing',	'en_US',	'Important changes to EU consumer protection laws',	'New regulations to help modernize and strengthen consumer protection laws in the European Union (EU) take effect on May 28, 2022. These rules impact all merchants selling to the EU, regardless of where their business is located. Further detailed information is available on the European Commission\'s official website.',	'{}',	'unactioned',	'woocommerce.com',	'2022-06-04 20:30:29',	NULL,	0,	'plain',	'',	0,	'info',	0),
(74,	'wc_ipp_order_creation_GTM_launch_q2_2022',	'marketing',	'en_US',	'Grow your business on the go with WooCommerce In-Person Payments',	'Quickly create new orders, manage transactions, and take secure payments no matter where your business takes you. With automatic inventory sync, WooCommerce In-Person Payments is the only fully integrated solution for taking your WooCommerce store offline.',	'{}',	'pending',	'woocommerce.com',	'2022-06-04 20:30:29',	NULL,	0,	'plain',	'',	0,	'info',	0),
(75,	'wc-admin-wisepad3',	'marketing',	'en_US',	'Take your business on the go in Canada with WooCommerce In-Person Payments',	'Quickly create new orders, accept payment in person for orders placed online, and automatically sync your inventory – no matter where your business takes you. With WooCommerce In-Person Payments and the WisePad 3 card reader, you can bring the power of your store anywhere.',	'{}',	'pending',	'woocommerce.com',	'2022-06-18 11:47:26',	NULL,	0,	'plain',	'',	0,	'info',	0),
(76,	'TikTok q2_2022',	'marketing',	'en_US',	'Give your store a stage on the world’s fastest-growing advertising channel',	'With TikTok for WooCommerce, you can sync your catalog, create videos, and track performance in front of TikTok’s one billion global users. Try the Smart Video Generator to make ads using your existing product images – no camera needed. Get $200 in ad credit from TikTok after a $20 spend (terms &amp; conditions apply).',	'{}',	'unactioned',	'woocommerce.com',	'2022-06-22 12:28:03',	NULL,	0,	'plain',	'',	0,	'info',	0),
(77,	'wc-admin-edit-products-on-the-move',	'info',	'en_US',	'Edit products on the move',	'Edit and create new products from your mobile devices with the Woo app',	'{}',	'unactioned',	'woocommerce-admin',	'2022-09-06 14:48:32',	NULL,	0,	'plain',	'',	0,	'info',	0),
